import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./index.css";
import HomePage from "./landin_page/Home/HomePage";
import Signup from "./landin_page/signup/SignupPage";
import About from "./landin_page/about/AboutPage";
import Support from "./landin_page/support/SupportPage";
import Pricing from "./landin_page/Home/PricingPage";
import Product from "./landin_page/products/ProductsPage";
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <BrowserRouter>
    <Routes>
      <Route path="/"element={<HomePage/>}></Route>
      <Route path="/Signup" element={<Signup/>}></Route>
      <Route path="/about" element={<About/>}></Route>
      <Route path="/products" element={<Product/>}></Route>
      <Route path="/pricing" element={<Pricing/>}></Route>
      <Route path="/support" element={<Support/>}></Route>
    </Routes> 
  </BrowserRouter>
);
